import React, {useState, useEffect} from 'react'

function App() {
  const [time, setTime] = useState(0)

  useEffect(() => {
    fetch("/").then(res => res.json()).then(data => {
      console.log(data)
      setTime(data.time)
    })
  }, [])
  return (
    <div>
      The time is {time}.
    </div>
  );
}

export default App;
